import axios from 'axios';
import React, { useEffect, useMemo, useState } from 'react';
import { DEALERS_COLUMN, STATES, DEALERS } from '../../assets/Json/DEALERS';
import { TableC } from '../../components/Table/TableC';

const Distributor = () => {
  const [ditri, setditri] = useState('');
  useEffect(() => {
    loadDistributor();
  }, []);

  const loadDistributor = async () => {
    const result = await axios.get('http://localhost:3003/distributors');
    setditri(result.data);
    console.log('result', result.data);
    console.log('daata', DEALERS);
  };
  const columns = useMemo(() => DEALERS_COLUMN, []);
  const data = useMemo(() => ditri, [ditri]);
  return ditri ===
    {
      id: '',
      name: '',
      city: '',
      state: '',
      contact: '',
    } ? (
    <div>hello</div>
  ) : (
    <TableC
      columns={columns}
      searchTitle='Distributor'
      searchPlaceHolder='Search Distributor'
      dropdownList={STATES}
      data={data}
      heading="Distributor's List"
      filter='name'
      dropfilter='state'
    />
  );
};

export default Distributor;
